(93, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-02-17 02:00:58', '2014-02-17 02:00:58', 1),
(109, 'Meline banner metro', 'banner-metro', '<div class="banner-metro">\r\n<div class="banner-metro-inner">\r\n<div class="banner banner1">\r\n<div class="banner-content banner-img"><img src="{{media url="wysiwyg/banner/banner1.png"}}" alt="" /></div>\r\n<div class="banner-content banner-desc">\r\n<p>Lorem ipsum dolor</p>\r\n<ul>\r\n<li>Tincidunt nulla a Nulla eu</li>\r\n<li>Cursus senectus aliquet pretium</li>\r\n<li>Consectetuer adipiscing elitelue eu</li>\r\n</ul>\r\n<a class="detail" href="#">Go to detail</a></div>\r\n</div>\r\n<div class="banner banner2 clearfix">\r\n<div class="banner-content banner-desc">\r\n<p>Lorem ipsum dolor</p>\r\n<ul>\r\n<li>Tincidunt nulla a Nulla eu</li>\r\n<li>Cursus senectus aliquet pretium</li>\r\n<li>Consectetuer adipiscing elitelue eu</li>\r\n</ul>\r\n<a class="detail" href="#">Go to detail</a></div>\r\n<div class="banner-content banner-img"><img src="{{media url="wysiwyg/banner/banner2.png"}}" alt="" /></div>\r\n</div>\r\n</div>\r\n</div>', '2014-03-28 21:17:07', '2014-04-01 19:38:59', 1),
(110, 'Meline banner violet', 'banner-violet', '<div class="banner-violet">\r\n<div class="banner-violet-inner">\r\n<img src="{{media url="wysiwyg/banner/banner-violet.png"}}" alt="" />\r\n<div class="banner-desc"><span>Lorem ipsum dolor</span>\r\n<p>Lorem ipsum dolor sit amet conse ctetur adip isicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>\r\n</div>\r\n<a class="detail" href="#">Go to detail</a>\r\n</div>\r\n</div>', '2014-04-01 18:43:04', '2014-04-14 01:07:16', 1),
(111, 'Meline banner top 1 - Welcome guest', 'banner-top1', '<div class="block-welcome col-lg-7 col-md-6 col-sm-7 col-xs-12">\r\n<div class="welcome-img"><img src="{{media url="wysiwyg/banner/banner-welcome.png"}}" alt="" /></div>\r\n<div class="welcome-content"><span>Welcome guest</span>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec et nisi eget nunc laoreet posuere. Suspendisse adipiscing placerat augue, dictum blandit justo laoreet a. Pellentesque quam vitae urna fermentum elementum. Pellentesque tincidunt neque non arcu scelerisque</p>\r\n<a class="button" href="{{config path="web/unsecure/base_url"}}about-magento-demo-store">Read more</a></div>\r\n</div>', '2014-04-01 20:26:03', '2014-05-21 19:47:09', 0),
(112, 'Meline banner top 2', 'banner-top2', '<div class="banner-top2">\r\n<ul>\r\n<li class="li-1  col-lg-4 col-md-4 col-sm-4 col-xs-12"><a class="banner-top2-img" href="#"><img src="{{media url="wysiwyg/banner/ico1-banner-top2.jpg"}}" alt="" /></a>\r\n<div class="li1-content"><a href="#">Free Shipping Item</a>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipis icing elit, sed do eiusmod tempor</p>\r\n</div>\r\n</li>\r\n<li class="li-2  col-lg-4 col-md-4 col-sm-4 col-xs-12"><a class="banner-top2-img" href="#"><img src="{{media url="wysiwyg/banner/ico2-banner-top2.jpg"}}" alt="" /></a>\r\n<div class="li2-content"><a href="#">30 Day Return Policy</a>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipis icing elit, sed do eiusmod tempor</p>\r\n</div>\r\n</li>\r\n<li class="li-3  col-lg-4 col-md-4 col-sm-4 col-xs-12"><a class="banner-top2-img" href="#"><img src="{{media url="wysiwyg/banner/ico3-banner-top2.jpg"}}" alt="" /></a>\r\n<div class="li3-content"><a href="#">Accepting orders 24/7</a>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipis icing elit, sed do eiusmod tempor</p>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>', '2014-04-01 20:31:57', '2014-05-21 19:51:52', 1),
(113, 'Meline customer say', 'customer-say', '<div class="block-customer-say col-lg-4 col-md-4 col-sm-6 col-xs-12">\r\n<div class="block-title">Customers say</div>\r\n<ul class="block-content">\r\n<li>\r\n<div class="customer-img"><img src="{{media url="wysiwyg/customer1.png"}}" alt="" /></div>\r\n<div class="customer-cont"><a class="cust-name" href="#">Alex Cross - Co founder</a>\r\n<div class="cust-cont">Fusce suscipit varius mi. Lorem ipsum dolor sit amet, co nsectetuer adipiscing elit. Praesent vestibulum molestie lacus.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class="customer-img"><img src="{{media url="wysiwyg/cusomer2.png"}}" alt="" /></div>\r\n<div class="customer-cont"><a class="cust-name" href="#">Alex Cross - Co founder</a>\r\n<div class="cust-cont">Fusce suscipit varius mi. Lorem ipsum dolor sit amet, co nsectetuer adipiscing elit. Praesent vestibulum molestie lacus.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class="customer-img"><img src="{{media url="wysiwyg/cusomer3.png"}}" alt="" /></div>\r\n<div class="customer-cont"><a class="cust-name" href="#">Alex Cross - Co founder</a>\r\n<div class="cust-cont">Fusce suscipit varius mi. Lorem ipsum dolor sit amet, co nsectetuer adipiscing elit. Praesent vestibulum molestie lacus.</div>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>', '2014-04-03 20:56:45', '2014-04-27 18:59:30', 1),
(114, 'Meline Promotion of the month', 'slide-promotion', '<div class="block-promotion col-lg-4 col-md-4 col-sm-12 col-xs-12">\r\n<div class="block-title">Promotion of the month</div>\r\n<div class="block-content">\r\n<div id="carousel-generic" class="carousel slide" data-ride="carousel" data-interval="0"><ol class="carousel-indicators">\r\n<li class="active" data-target="#carousel-generic" data-slide-to="0"></li>\r\n<li data-target="#carousel-generic" data-slide-to="1"></li>\r\n<li data-target="#carousel-generic" data-slide-to="2"></li>\r\n<li data-target="#carousel-generic" data-slide-to="3"></li>\r\n</ol>\r\n<div class="carousel-inner">\r\n<div class="item active"><a href="#"><img src="{{media url="wysiwyg/promotion1.png"}}" alt="" /></a></div>\r\n<div class="item"><a href="#"><img src="{{media url="wysiwyg/promotion2.jpg"}}" alt="" /></a></div>\r\n<div class="item"><a href="#"><img src="{{media url="wysiwyg/promotion3.jpg"}}" alt="" /></a></div>\r\n<div class="item"><a href="#"><img src="{{media url="wysiwyg/promotion4.jpg"}}" alt="" /></a></div>\r\n</div>\r\n<div class="promotion-ico">Sale</div>\r\n</div>\r\n</div>\r\n</div>', '2014-04-03 21:45:49', '2014-05-08 21:27:20', 1),
(115, 'Meline More information', 'spotlight-1', '<div class="col-lg-3 col-md-3 col-sm-6 col-xs-12 spotlight spotlight1">\r\n<div class="block-title">More information</div>\r\n<div class="block-content">\r\n<ul>\r\n<li><a href="{{config path="web/secure/base_url"}}about-magento-demo-store">About Us</a></li>\r\n<li><a href="#">Customer Service</a></li>\r\n<li><a href="#">Privacy Policy</a></li>\r\n<li><a href="#">Advance Search</a></li>\r\n<li><a href="#">Orders and Returns</a></li>\r\n</ul>\r\n</div>\r\n</div>', '2014-04-04 18:32:31', '2014-04-14 21:36:23', 1),
(116, 'Meline Follow us', 'spotlight-2', '<div class="col-lg-3 col-md-3 col-sm-6 col-xs-12 spotlight spotlight2">\r\n<div class="block-title">Follow us</div>\r\n<div class="block-content">\r\n<ul>\r\n<li><a title="Facebook" href="http://www.facebook.com/MagenTech" target="_blank"><em class="icon-facebook"></em>Follow us on facebook</a></li>\r\n<li><a title="Twitter" href="https://twitter.com/magentech" target="_blank"><em class="icon-twitter"></em>Follow us on twitter</a></li>\r\n<li><a title="LinkedIn" href="http://www.linkedin.com/in/magentech" target="_blank"><em class="icon-linkedin-sign"></em>Follow us on linkedin</a></li>\r\n<li><a href="#"><em class="icon-rss"></em>RSS feeds</a></li>\r\n</ul>\r\n</div>\r\n</div>', '2014-04-04 18:47:12', '2014-04-04 20:37:37', 1),
(117, 'Meline Newsletter', 'spotlight-3', '<div class="col-lg-3 col-md-3 col-sm-6 col-xs-12 spotlight spotlight3">\r\n<div class="block-title">Newsletter</div>\r\n<div class="block-content"><form id="newsletter-validate-detail" action="newsletter/subscriber/new/" method="post">\r\n<p>Fusce suscipit varius mi. Lorem ipsum dolor sit amet, co nsectetuer adipiscing elit.</p>\r\n<div class="input-box"><input id="newsletter" class="input-text required-entry validate-email" title="Sign up for our newsletter" onfocus="if(this.value==''Enter your email address....'') this.value='''';" onblur="if(this.value=='''') this.value=''Enter your email address....'';" type="text" name="email" value="Enter your email address...." /> <button type="submit"><span>Send</span></button></div>\r\n</form></div>\r\n</div>', '2014-04-04 18:49:38', '2014-04-04 20:29:51', 1),
(118, 'Meline contact us', 'spotlight-4', '<div class="col-lg-3 col-md-3 col-sm-6 col-xs-12 spotlight spotlight4">\r\n<div class="block-title">Contact us</div>\r\n<div class="block-content">\r\n<p>Address : Our business address is 1063 Freelon Street - San Francisco, CA 95108</p>\r\n<p>Email : <a href="mailto:contact@viste.com">support@meline.com</a></p>\r\n<p>Phone : 0123456789</p>\r\n</div>\r\n</div>', '2014-04-04 19:09:18', '2014-04-04 19:09:18', 1),
(119, 'Meline logo footer payment', 'under-spotlight', '<div class="before-footer">\r\n<div class="share-logo col-lg-9 col-md-9 col-sm-8 col-xs-12">\r\n<div class="logo-footer">Logo In footer</div>\r\n<!-- AddThis Button BEGIN -->\r\n<div class="addthis_toolbox addthis_default_style "><a class="addthis_button_facebook_like">&nbsp;</a> <iframe style="width: 95px; height: 20px; float: left;" src="https://platform.twitter.com/widgets/tweet_button.html" frameborder="0" scrolling="no" width="320" height="240"></iframe>\r\n<a class="addthis_button_pinterest_pinit">&nbsp;</a> <a class="addthis_counter addthis_pill_style">&nbsp;</a>\r\n</div>\r\n<script type="text/javascript">// <![CDATA[\r\n								var addthis_config = addthis_config||{};\r\n								addthis_config.data_track_addressbar = false;\r\n// ]]></script>\r\n<script type="text/javascript" src="//s7.addthis.com/js/300/addthis_widget.js#pubid=ra-529be2200cc72db5"></script>\r\n<!-- AddThis Button END --></div>\r\n<div class="payment col-lg-3 col-md-3 col-sm-4 col-xs-12">\r\n<ul>\r\n<li><a href="#"><img src="{{media url="wysiwyg/payment1.png"}}" alt="" /></a></li>\r\n<li><a href="#"><img src="{{media url="wysiwyg/payment2.png"}}" alt="" /></a></li>\r\n<li><a href="#"><img src="{{media url="wysiwyg/payment3.png"}}" alt="" /></a></li>\r\n</ul>\r\n</div>\r\n</div>', '2014-04-04 20:55:53', '2014-04-04 21:19:39', 1),
(120, 'Meline Top Rating Product', 'toprating-pro', '<p>{{block type="basicproducts/home" name="toprated" template="sm/basicproducts/toprated.phtml" title="Top rating" product_source="product" product_ids="446,447,448" product_order_by="price" num_columns="1" product_limitation="3" product_image_width="84" product_image_height="84" product_title_max_length="20" product_title_disp="1" product_rating_summary="1" product_description_disp="0" product_cart_or_status="0" product_addtocompare="0"}}</p>', '2014-04-10 02:07:13', '2014-04-10 19:00:30', 1),
(121, 'Meline Banner Opening hours', 'banner-opening-hours', '<div class="banner-openinghours">\r\n<div class="open-title">Opening Hours</div>\r\n<div class="open-desc">Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy</div>\r\n<div class="open-hours"><p>MON to TUE - 10 AM to 20 PM</p><p>SAT - 12 AM to 24 PM</p><p>SUN - 12 AM to 20 PM</p></div>\r\n</div>', '2014-04-10 02:37:26', '2014-04-10 02:46:24', 1),
