(123, 'Meline Map contact us', 'map-contact', '<script type="text/javascript" src="http://maps.google.com/maps/api/js?v=3&amp;sensor=false"></script>\r\n<div id="gmap_canvas" style="height: 500px; width: 100%;">&nbsp;</div>\r\n<script type="text/javascript">// <![CDATA[\r\nfunction init_map(){ var myOptions={zoom:15, center: new google.maps.LatLng (48.856614,2.3522219000000177), mapTypeId: google.maps.MapTypeId.ROADMAP}; map = new google.maps.Map (document.getElementById("gmap_canvas"), myOptions); marker = new google.maps.Marker({map: map, position: new google.maps.LatLng (48.856614,2.3522219000000177)}); infowindow = new google.maps.InfoWindow ({content:"<span style=''height:auto !important; display:block; white-space:nowrap; overflow:hidden !important;''><strong style=''font-weight:400;''>Paris</strong><br><br> Paris</span>" }); google.maps.event.addListener (marker, "click", function(){ infowindow.open(map,marker);}); } google.maps.event.addDomListener (window, "load", init_map);\r\n// ]]></script>', '2014-04-14 02:25:54', '2014-04-18 21:10:10', 1),
(124, 'Meline Infomation contact us', 'info-contact', '<div class="contact-info">\r\n<div class="contact-desc">\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Nam fringilla augue nec est tristique auctor. Donec non est at libero vulputate rutrum. Morbi ornare lectus quis justo gravida semper. Nulla tellus mi, vulputate adipiscing cursus eu, suscipit id nulla. Donec a neque libero\r\n</div>\r\n<div class="contact-address">\r\n<p>Address : Our business address is 1063 Freelon Street - San Francisco, CA 95108</p>\r\n<p>Email : <a href="mailto:contact@viste.com">support@meline.com</a></p>\r\n<p>Phone : 0123456789</p>\r\n</div>\r\n</div>', '2014-04-14 02:37:22', '2014-04-14 02:37:22', 1),
(125, 'Footer', 'footer', '<p>&copy; 2014 <a href="http://www.magentech.com/themes/premium-themes" target="_blank">Magento Themes</a> Demo Store. All Rights Reserved. Designed by <a title="Visit MagenTech.Com!" href="http://www.magentech.com/" target="_blank">MagenTech.Com</a></p>', '2014-04-28 20:06:38', '2014-04-28 20:10:07', 1),
