(1, '404 Not Found', 'one_column', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-head-alt">\r\n<h3>Whoops, our bad...</h3>\r\n</div>\r\n<dl><dt>The page you requested was not found, and we have a fine guess why.</dt><dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul>\r\n</dd></dl>\r\n<p>&nbsp;</p>\r\n<dl><dt>What can you do?</dt><dd>Have no fear, help is near! There are many ways you can get back on track with Magento Demo Store.</dd><dd>\r\n<ul class="disc">\r\n<li><a onclick="history.go(-1);" href="#">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a><br /><a href="{{store url="customer/account"}}">My Account</a></li>\r\n</ul>\r\n</dd></dl>\r\n<p>&nbsp;</p>\r\n<p><img style="margin-right: 15px;" src="{{skin url=''images/media/404_callout1.jpg''}}" alt="" /><img src="{{skin url=''images/media/404_callout2.jpg''}}" alt="" /></p>', '2007-06-20 11:38:32', '2014-04-14 21:32:28', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'SM Meline - Responsive Magento Theme for Multi-purpose Websites', 'one_column', 'sm meline, magento theme, responsive theme, responsive magento theme, flat design theme, innovative device theme', 'SM Meline, new website experience with flat and colorful design will make it more attractive for all ages. Highlight your most innovative products with this incredible theme.', 'home', NULL, '<div class="no-display">&nbsp;</div>', '2007-08-23 03:03:25', '2015-07-01 03:09:26', 1, 0, '<remove name="breadcrumbs" />\r\n<reference name="camera-slide">\r\n    <block type="sm_cameraslide/slide_preview" name="sm_cameraslide" as="cameraslide" />\r\n</reference>\r\n<reference name="banner-top">\r\n			<block type="cms/block" name="banner-top2">\r\n				<action method="setBlockId"><block_id>banner-top2</block_id></action>\r\n			</block>\r\n</reference>\r\n<reference name="content">\r\n    <block type="tablisting/list" name="tablisting">\r\n    	<action method="setConfig"></action>\r\n     </block>\r\n</reference>\r\n<reference name="banner-bottom">\r\n     <block type="cms/block" name="banner-bottom1">\r\n            <action method="setBlockId"><block_id>banner-bottom</block_id></action>\r\n      </block>\r\n</reference>\r\n<reference name="content-bottom">\r\n       <block type="basicproducts/home" name="toprated" template="sm/basicproducts/toprated.phtml">			\r\n	</block>\r\n        <block type="cms/block" name="customer-say">\r\n            <action method="setBlockId"><block_id>customer-say</block_id></action>\r\n        </block>\r\n        <block type="cms/block" name="slide-promotion">\r\n            <action method="setBlockId"><block_id>slide-promotion</block_id></action>\r\n      </block>\r\n</reference>\r\n<reference name="slider">\r\n	<block type="slider/list" name="slider.list.default" template="sm/slider/default.phtml">\r\n		       <action method="setConfig">\r\n                                 <values>  \r\n                                        <product_source>catalog</product_source>\r\n                                         <block_title></block_title>\r\n                                         <slider_title_text>Best smartphone 2014</slider_title_text>\r\n                                          <product_category>326</product_category>\r\n                                           <product_image_height>270</product_image_height>\r\n                                            <product_image_width >270</product_image_width>\r\n                                            <product_limitation>10</product_limitation>\r\n                                             <product_order_dir>ASC</product_order_dir>\r\n                                            <product_order_by>name</product_order_by>\r\n                                            <anchor>top</anchor>\r\n                                            <scroll>1</scroll>\r\n                                            <deviceclass_sfx>preset01-4 preset02-3 preset03-2 preset04-2 preset05-1</deviceclass_sfx>\r\n                                            <duration>500</duration>\r\n                                </values>\r\n                   </action>\r\n	</block>         \r\n</reference>\r\n<reference name="slider-logo">\r\n     <block type="slider/list" name="img-slider" template="sm/slider/default2.phtml"></block>\r\n</reference>\r\n\r\n', NULL, NULL, NULL, NULL, NULL),
