(13, 'SM Meline - Responsive Magento Theme for Multi-purpose Websites', 'two_columns_right', 'sm meline, magento theme, responsive theme, responsive magento theme, flat design theme, innovative device theme', 'SM Meline, new website experience with flat and colorful design will make it more attractive for all ages. Highlight your most innovative products with this incredible theme.', 'home-right', NULL, '<div class="no-display">&nbsp;</div>', '2014-02-25 19:16:16', '2015-07-01 03:08:56', 1, 0, '<remove name="breadcrumbs" />\r\n<reference name="camera-slide">\r\n    <block type="sm_cameraslide/slide_preview" name="sm_cameraslide" as="cameraslide" />\r\n</reference>\r\n<reference name="banner-top">\r\n			<block type="cms/block" name="banner-top2">\r\n				<action method="setBlockId"><block_id>banner-top2</block_id></action>\r\n			</block>\r\n</reference>\r\n<reference name="content">\r\n    <block type="tablisting/list" name="tablisting">\r\n    	   <action method="setConfig">\r\n           <values>  \r\n                     <nb_column0>3</nb_column0>		\r\n                     <nb_column1>3</nb_column1>		\r\n                      <nb_column2>2</nb_column2>		\r\n                        <nb_column3>2</nb_column3>		\r\n                       <nb_column4>1</nb_column4>		\r\n                        <product_limitation>6</product_limitation>		\r\n              </values>\r\n          </action>\r\n     </block>\r\n</reference>\r\n<reference name="banner-bottom">\r\n     <block type="cms/block" name="banner-bottom1">\r\n            <action method="setBlockId"><block_id>banner-bottom</block_id></action>\r\n      </block>\r\n</reference>\r\n<reference name="content-bottom">\r\n       <block type="basicproducts/home" name="toprated" template="sm/basicproducts/toprated.phtml">			\r\n	</block>\r\n        <block type="cms/block" name="customer-say">\r\n            <action method="setBlockId"><block_id>customer-say</block_id></action>\r\n        </block>\r\n        <block type="cms/bl